reviewContent:
부지런히 해야겠습니다~^^
쟁여놓는중이라.. 비즈 혹시 나중에 모자르더라도
보내주실까요~?^^;;

투명 비닐커버 + 접착 비닐커버 안에... 무슨 &lt;검은 테이프에 사람 머리카락&gt;까지 들어있네요;;; 

사진 보자마자 비닐 뜯어버리고 접착커버 저 부분까지 열어서 테이프 뜯고 머리카락 뜯고 만져보니까 테이프 부분은 접착이 다 사라졌어요... 

요청 사항에 일부러 하자검수 부탁드린다고 썼는데 이런게 왔어요..

주문한지 주말끼고 3일정도만에 받았고 하루에6-8시간 정도씩 하니까 3일만에 완성했네요. 예뻐요-&hearts;
재료가 생각보다 많이 남는게 좀 아까워요...
거의 작품하나 더 할 수 있는 정도로 남았는데 버리기도 그렇고 이부분은 환경을 위해서도 개선되면 좋겠다는 개인적인 생각입니다ㅎㅎ

그림이 엄청예쁘고 비즈도 넉넉해요.
다만 캔버스 나무틀이 살짝 부러져서 왔어요;;
몰랐다가 비즈 붙인다음에 알아서 테이프로 고정하고 쓰고있어요

아이들이 너무재밌어하네요 
시간가는줄모르고 하고있어요^^
&hearts;
